jQuery.noConflict();

const CONTAINER_IDS = {
    DemoGame: [764914],
    CatchGame: [768264]
    // 765513, 765516, 765514, 765515, 768249, 768250, 765551, 765523, 765522, 765521
};

function addGlobalStyle(css) {
    // Seeking for header
    var head = document.getElementsByTagName('head')[0];
    // Preparing style container
    var style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    // Include container to header
    head.appendChild(style);
}

class ArcadiaGame {
    constructor(area) {
        // Constants
        this.ressource_url = "https://drive.google.com/uc?export=view&id="

        // Add some css style
        addGlobalStyle("#arcadia { background-color: black; }");
        addGlobalStyle("@font-face { font-family: 'Karmatic'; src: url(data:font/truetype;charset=utf-8;base64,) format('truetype'); }");

        // Prepare canvas
        this.canvas = document.createElement("canvas");
        this.canvas.id = 'arcadia';
        this.canvas.width = 230;
        this.canvas.height = 230;
        this.ctx = this.canvas.getContext("2d");

        // Change description for game container
        jQuery(area).html(this.canvas);

        // Handle keyboard controls
        this.keysDown = {};

        // Data for ressources loader
        this.load_count = 0;
        this.load_url = {
            lineImage: { src: this.ressource_url + "1IWDOGefMfKVAWYgMaMebhEy2x2FEN_6P" },
            fgImage: { src: this.ressource_url + "1IcKa3STYy8a1FM3BA9_93DY7MpoQk8_F" },
        };

        // Create arcadia image objects
        this.lineImage = new Image();
        this.fgImage = new Image();
    }

    loader(destination, data) {
        if (data.hasOwnProperty('src')) {
            destination.onload = jQuery.proxy(this.loaded, this);
            destination.setAttribute('src', data.src);
        } else {
            for (var key in data) {
                this.loader(destination[key], data[key]);
            }
        }
    }

    is_loaded() {
        if (this.load_count >= Object.keys(this.load_url).length) {
            return true;
        }
        return false;
    }

    loaded() {
        this.load_count++;
        // When load are completed init the game
        if (this.is_loaded()) {
            this.reset();
            this.main();
        }
    }

    // Rendering canvas
    render() {
        // Game have to call
        if (!super.render_before()) { return; }
        // Game specific rendering instructions
        super.render_after();
    }

    // Rendering canvas (initializations and loadings)
    render_before() {
        // Define default text style
        this.ctx.fillStyle = "rgb(0, 250, 0)";
        this.ctx.font = "14px Karmatic";
        this.ctx.textAlign = "left";
        this.ctx.textBaseline = "top";

        // Before ressources load, display Loading screen
        if (!this.is_loaded()) {
            this.ctx.fillStyle = "rgb(0, 0, 0)";
            this.ctx.fillRect(0, 0, this.canvas.width, this.canvas.height);
            this.ctx.fillStyle = "rgb(0, 255, 0)";
            this.ctx.fillText("Loading " + this.load_count + "..." + Object.keys(this.load_url).length, 50, 100);
            return false;
        }

        return true;
    }

    // Rendering canvas (arcade context redering)
    render_after() {
        // Display screen scanline
        this.ctx.globalAlpha = 0.2;
        this.ctx.drawImage(this.lineImage, 0, 0);
        // Display screen borders
        this.ctx.globalAlpha = 1;
        this.ctx.drawImage(this.fgImage, 0, 0, this.canvas.width, this.canvas.height);
    }

    // Reset the game
    reset() {
        // Game have to create this method
    }

    // Update game objects
    update(modifier) {
        // Game have to create this method
    }

    // The main game loop
    main() {
        var now = Date.now();
        var delta = now - this.then;

        this.update(delta / 1000);
        this.render();
        this.then = now;
    }
}

class DemoGame extends ArcadiaGame {
    constructor(area) {
        super(area);

        // Add game ressources to default load list
        this.load_url = jQuery.extend(this.load_url, {
            hero: { img: { src: this.ressource_url + "1mgLQPRxNa6sHfv6S4pclt7QFG_Gjn1oR" } },
            monster: { img: { src: this.ressource_url + "11Ees19JFnNryMdwEchXAbtPL-zPnSDRZ" } },
            bgImage: { src: this.ressource_url + "1ivTQ5ha6tHDvHqoPESaOFu2K88nX7HbP" },
        });

        // Hero image
        var heroImage = new Image();
        heroImage.setAttribute('width', '16px');
        heroImage.setAttribute('height', '16px');

        // Hero data
        this.hero = {
            speed: 64, // movement in pixels per second
            img: heroImage,
            x: this.canvas.width / 2,
            y: this.canvas.height / 2
        };

        // Monster image
        var monsterImage = new Image();

        // Monster data
        this.monstersCaught = 0;
        this.monster = {
            img: monsterImage
        };

        // Background image
        this.bgImage = new Image();

        // Load images
        for (var key in this.load_url) {
            this.loader(this[key], this.load_url[key]);
        }

        // Load sounds
        this.audio_knife = new Audio(this.ressource_url + "1o4A4s1GpWU2eZOSbOIx1KAyz_GDhiwkU");
        this.audio_start = new Audio(this.ressource_url + "11FiD0EhJdRYlG4q6mEhPaIiL4MoHVCJg");
        this.audio_start.play();

        this.then = Date.now();
    }

    render() {
        // Initialize canvas
        if (!super.render_before()) { return; }

        // Draw map
        for (var x=-16; x<this.canvas.width; x+=32) {
            for (var y=-16; y<this.canvas.height; y+=32) {
                this.ctx.drawImage(this.bgImage, x, y);
            }
        }

        // Display entities
        this.ctx.drawImage(this.hero.img, this.hero.x, this.hero.y);
        this.ctx.drawImage(this.monster.img, this.monster.x, this.monster.y);

        // Display score
        var score = "attrape: " + this.monstersCaught;
        if (this.monstersCaught > 1) {
            score = score.replace("attrape", "attrapes");
        }
        this.ctx.fillText(score, 10, 10);

        // Finalize render with Arcadia screen
        super.render_after();
    }

    // Reset the game
    reset() {
        // Throw the monster somewhere on the screen randomly
        this.monster.x = 32 + (Math.random() * (this.canvas.width - 64));
        this.monster.y = 32 + (Math.random() * (this.canvas.height - 64));
    }

    // Update game objects
    update(modifier) {
        if (38 in this.keysDown) { // Player holding up
            this.hero.y -= this.hero.speed * modifier;
        }
        if (40 in this.keysDown) { // Player holding down
            this.hero.y += this.hero.speed * modifier;
        }
        if (37 in this.keysDown) { // Player holding left
            this.hero.x -= this.hero.speed * modifier;
        }
        if (39 in this.keysDown) { // Player holding right
            this.hero.x += this.hero.speed * modifier;
        }

        // Are they touching?
        if (
            this.hero.x <= (this.monster.x + 32)
            && this.monster.x <= (this.hero.x + 32)
            && this.hero.y <= (this.monster.y + 32)
            && this.monster.y <= (this.hero.y + 32)
        ) {
            this.audio_knife.play();
            ++this.monstersCaught;
            this.reset();
        }
    }
}

