jQuery(document).ready(function() {
    // Look if infoBox changed
    jQuery('#zone_infoBoxFixed').bind("DOMNodeInserted", function(event) {
        // Ensure to check a direct child of infoBoxFixed
        if (event.target.parentNode.id != "zone_infoBoxFixed") { return; }
        // Get the element which changed in infoBox
        var infoBox = jQuery(event.target);
        // Look which game to load depending on item id
        var container = undefined;
        get_container:
        for (var gameId in CONTAINER_IDS) {
            for (var itemId=0; itemId<=CONTAINER_IDS[gameId].length; itemId++) {
                if (infoBox.filter(":contains('" + CONTAINER_IDS[gameId][itemId] + "')").length > 0) {
                    console.info(gameId, itemId, CONTAINER_IDS[gameId][itemId]);
                    container = infoBox.filter(":contains('" + CONTAINER_IDS[gameId][itemId] + "')");
                    break get_container;
                }
            }
        }
        // If nothing found, abort
        if (typeof container == 'undefined') { return; }

        // Look for description and load game object in it
        var area = container.find("p");
        var game = eval("new " + gameId + "(area)");

        // Attach events
        addEventListener("keydown", function (e) {
            game.keysDown[e.keyCode] = true;
        }, false);
        addEventListener("keyup", function (e) {
            delete game.keysDown[e.keyCode];
        }, false);

        // The main game loop
        var arcadiaMain = function () {
            game.main();
        };
        // Setup game refresh rate to 50 FPS
        setInterval(arcadiaMain, 1000 / 20);
    });
});